import react from 'react';
import PropTypes from 'prop-types';

const AppLayout = ({ children }) => {
  return (
    <div>
      <div>공통메뉴</div>
      {children}
    </div>
  );
}; //return 안의 모든 값들이 node 화면에 비추는 모든것 react의 node

AppLayout.propTypes = {
  children: PropTypes.node.isRequired,
};

export default AppLayout;
